import React from 'react';
import BookingForm from './components/bookingform';

const style = {
  mainContainer: {
    display: 'flex',
    flexDirection: 'row', // Change the direction to "row"
    alignItems: 'center',
  },
  image: {
    maxWidth: '100%', // Make the image responsive
    height: 'auto', // Maintain the aspect ratio
  },
}

function App() {

  return (
    <div>
      <div style={style.mainContainer}>
        <img src="https://storage.googleapis.com/mixo-files/logos/1698925507587-cabRide-9o1z.svg" style={style.image}></img>
        <h1>Cab Booking System</h1>
      </div>
      <div style={style.mainContainer}>
        <BookingForm />
      </div>
    </div>
  );
}

export default App;
